ntly become voluminous spaces. Their light, mobile and soft qualities entice people to be both dazzled spectators and playful participants.\n\nFloating Utopias shows how inflatable objects have opened up new technological possibilities through history. With the invention of the hot air balloon, humanity was able to leave the confines of the ground for the first time and experience the Earth from above. Floating Utopias explores how this pivotal invention shaped the way we understand the world and our place in it. The exhibition shows how inflatable objects were used the first part of the 20th century, in socialist and capitalist mass parades, and how, in the 1960s, a new generation of architects began using inflatable structures in a search for new approaches to designing space and alternative ways of living. Floating Utopias also explores how inflatable structures can help us rethink our relationship with the environment.","_key":"05,1,1462,,","allowMultiEntry":null,"demandType":null,"products":[{"id":4864,"class":"com.globaltix.api.v1.Product"},{"id":4865,"class":"com.globaltix.api.v1.Product"}],"openItemType":null,"currency":{"id":1,"class":"com.globaltix.api.v1.Currency"},"emailTrigger":0,"visitDate":{"id":397,"class":"com.globaltix.api.v1.VisitDateSettings"},"id":3651,"cloudApi":null,"class":"com.globaltix.api.v1.TicketTypeGroup","isOpenDated":false,"additionalRestriction":null,"showTypeName":true,"customName":1,"howToUse":[{"id":13056,"class":"com.globaltix.api.v1.HowToUse"},{"id":13057,"class":"com.globaltix.api.v1.HowToUse"},{"id":13058,"class":"com.globaltix.api.v1.HowToUse"}],"multiEntryType":null,"attraction":{"id":1462,"class":"com.globaltix.api.v1.Attraction"},"series":[],"isAddOn":0,"name":"Floating Utopias (UAT)","multiEntryValue":null,"requireCustomerEmail":null,"cancellationPolicy":{"id":2113,"class":"com.globaltix.api.v1.CancellationPolicy"},"inclusions":[{"id":5374,"class":"com.globaltix.api.v1.Inclusions"},{"id":5373,"class":"com.globaltix.api.v1