!\n\nDiscover how artists and filmmakers have portrayed Alice and her story for over a century. Since her first appearance on the page in 1865, Alice has delighted audiences in more than 40 films and over 30 television programmes, and has become a subcultural icon through her presence in music videos, video games, high fashion, advertising and more. Drawing together a remarkable selection of original behind-the-scenes material, Wonderland includes over 300 artefacts and objects including first edition books, drawings, original costumes, films, magic lantern projectors, animation and puppetry.\n\nDeveloped by Australian Centre for the Moving Image (ACMI), this ground-breaking exhibition has just been award the 2019 GLAMis Best in Show award as well as the GLAMi Exhibition Media or Experience: Immersive Category award in the 23rd annual MuseWeb conference in Boston, USA. This award-winning exhibition makes its first stop of a global tour at ArtScience Museum.","_key":"04,1,1462,,","allowMultiEntry":null,"demandType":null,"products":[{"id":4862,"class":"com.globaltix.api.v1.Product"},{"id":4863,"class":"com.globaltix.api.v1.Product"}],"openItemType":null,"currency":{"id":1,"class":"com.globaltix.api.v1.Currency"},"emailTrigger":0,"visitDate":{"id":396,"class":"com.globaltix.api.v1.VisitDateSettings"},"id":3650,"cloudApi":null,"class":"com.globaltix.api.v1.TicketTypeGroup","isOpenDated":false,"additionalRestriction":null,"showTypeName":true,"customName":1,"howToUse":[{"id":13054,"class":"com.globaltix.api.v1.HowToUse"},{"id":13053,"class":"com.globaltix.api.v1.HowToUse"},{"id":13055,"class":"com.globaltix.api.v1.HowToUse"}],"multiEntryType":null,"attraction":{"id":1462,"class":"com.globaltix.api.v1.Attraction"},"series":[],"isAddOn":0,"name":"Wonderland (UAT)","multiEntryValue":null,"requireCustomerEmail":null,"cancellationPolicy":{"id":2112,"class":"com.globaltix.api.v1.CancellationPolicy"},"inclusions":[{"id":5370,"class":"com.globaltix.api.v1.Inclusions"},{"id":5371,