 those wanting to watch the activity but not get involved - Suitable for non-swimmers. Flotation devices are optional - Wetsuits will be provided for all programs - Personal photography and video are not allowed - Professional photographers are available onsite and will provide photographs for a fee GUESTS: - Will be required to shower prior to entering any pool or experiencing any attractions - Must be at least 110cm in height to participate - Children below 110cm in height must be accompanieed by a paying adult participant - If age 20 and below, must have a parent or guardian (21 years old and above) to authorize participation - If age 12 and below, must be accompanied in the water by a paying adult participant - There must be no more than 3 children accompanied by 1 adult **Important reminders:** - Bring appropriate swimwear to be worn under wetsuit (Swimwear Policy can be found [here](http://www.rwsentosa.com/LinkClick.aspx?file-ticket=8JvxuTHnWhc%3d&tabid=1390&language=en-US)) - DO NOT apply any type of tanning oil or sunscreen before entering the water - Do not bring any food and drinks into the par","title":"Dolphin Island Interaction Programs","attractionHighlights":[],"imagePathSecondary":"","lastUpdated":"2017-06-19T05:21:32Z","dateCreated":"2017-06-19T05:21:31Z","id":432,"ticketTypeGroups":[{"code":"02","orderFulfillment":null,"requireReceiptCode":null,"applyCapacity":false,"isAdvanceSellingPeriod":null,"questions":[{"id":2206,"class":"globaltix.api.Question"},{"id":2207,"class":"globaltix.api.Question"}],"description":"Your tickets/vouchers will be send to you seperately.","_key":"02,1,432,,","allowMultiEntry":false,"demandType":null,"products":[{"id":1146,"class":"com.globaltix.api.v1.Product"},{"id":1147,"class":"com.globaltix.api.v1.Product"},{"id":1148,"class":"com.globaltix.api.v1.Product"}],"openItemType":null,"currency":{"id":3,"class":"com.globaltix.api.v1.Currency"},"emailTrigger":null,"visitDate":null,"id":963,"cloudApi":null,"class":"com.globa