-singapore/)! - Complete your experience at the Night Safari with a special language tram - Japanese or Mandarin Chinese or feast on a wild buffet, click [here](https://www.klook.com/activity/1411-night-safari-package-add-ons-singapore/) for more details - For dated tickets with confirmed entry timing, please [click here](https://www.klook.com/activity/122-singapore-night-safari-singapore/)","hoursOfOperation":"**Inclusive Of:** - Open dated ticket to Night Safari (including shows) - 1 round of tram ride **Available Timeslots for Entry:** - 7:15pm - 8:15pm - 9:15pm - 10:15pm **Important Note:** - Entry tickets for the day can only be redeemed on the day itself - Timeslots for the entry can only be selected on the day itself and you may have to wait for later timeslots if the earlier timeslots are full - If you wish to enter the park early, we strongly recommend that you purchase dated tickets with confirmed entry time [here](https://www.klook.com/activity/122-singapore-night-safari-singapore/) **Additional Information:** - Child ticket: Age 3-12 - Free WiFi is available at the entrance","title":"Singapore Night Safari Open Dated Ticket","attractionHighlights":[],"imagePathSecondary":"","lastUpdated":"2017-06-19T20:37:41Z","dateCreated":"2017-06-19T20:37:40Z","id":1200,"ticketTypeGroups":[{"code":"00","orderFulfillment":null,"requireReceiptCode":null,"applyCapacity":false,"isAdvanceSellingPeriod":null,"questions":[{"id":11385,"class":"globaltix.api.Question"}],"description":"Your tickets/vouchers will be send to you seperately.","_key":"00,1,1200,,","allowMultiEntry":false,"demandType":null,"products":[{"id":3977,"class":"com.globaltix.api.v1.Product"},{"id":3976,"class":"com.globaltix.api.v1.Product"}],"openItemType":null,"currency":{"id":3,"class":"com.globaltix.api.v1.Currency"},"emailTrigger":null,"visitDate":null,"id":2972,"cloudApi":null,"class":"com.globaltix.api.v1.TicketTypeGroup","isOpenDated":null,"additionalRestriction":false,"showTypeName":true,"customNa