ute and continue your exploration journey on foot!","hoursOfOperation":"**Inclusive Of:** - River cruise ticket (full journey approx. 40 minutes) - Audio visual commentary in English on board **Cruise Route:** - Click [here](http://res.klook.com/image/upload/v1493195172/singapore_river_cruise_kdnhjk.jpg) to view the cruise route - You may disembark at any of the following jetties: - Clarke Quay - Read Bridge - Boat Quay - Fullerton - Merlion park - Bayfront South - Esplanade - Please note that you will not be allowed to re-board the boat once youve disembarked **Additional Information:** - Child ticket: Age 3-12","title":"Singapore River Cruise","attractionHighlights":[],"imagePathSecondary":"","lastUpdated":"2017-06-19T20:17:01Z","dateCreated":"2017-06-19T20:17:00Z","id":1187,"ticketTypeGroups":[{"code":"00","orderFulfillment":null,"requireReceiptCode":null,"applyCapacity":false,"isAdvanceSellingPeriod":null,"questions":[{"id":11181,"class":"globaltix.api.Question"}],"description":"Your tickets/vouchers will be send to you seperately.","_key":"00,1,1187,,","allowMultiEntry":false,"demandType":null,"products":[{"id":3918,"class":"com.globaltix.api.v1.Product"},{"id":3919,"class":"com.globaltix.api.v1.Product"}],"openItemType":null,"currency":{"id":3,"class":"com.globaltix.api.v1.Currency"},"emailTrigger":null,"visitDate":null,"id":2934,"cloudApi":null,"class":"com.globaltix.api.v1.TicketTypeGroup","isOpenDated":null,"additionalRestriction":false,"showTypeName":true,"customName":1,"howToUse":[{"id":8811,"class":"com.globaltix.api.v1.HowToUse"},{"id":11990,"class":"com.globaltix.api.v1.HowToUse"}],"multiEntryType":null,"attraction":{"id":1187,"class":"com.globaltix.api.v1.Attraction"},"series":[],"isAddOn":0,"name":"Singapore River Cruise","multiEntryValue":null,"requireCustomerEmail":null,"cancellationPolicy":null,"inclusions":[]}],"email":null,"longitude":null,"favorited":false,"lastUpdatedBy":"2219","types":[],"website":null,"merchant":{"country":{"id":3,"class":"c